import React from 'react';
import Gamer from '../Images/Confused_Gamer.png';
import Weather from '../Images/Weather_App.png';

const Portfolio = () => {
  return (
    <div class="container bg-light d-flex project-container">
      <div class="row">
        <div
          id="confusedGamer"
          onclick="location.href='https://webdeverdan.github.io/Confused-Gamer/';"
        >
          <img src={Gamer} className="Gamer" />
          {/* <div class="designtext">Video Game Picker</div> */}
        </div>
        <div
          id="weatherChecker"
          onclick="location.href='https://webdeverdan.github.io/Weather-Dashboard/';"
        >
          <img src={Weather} className="Weather" />
          {/* <div class="designtext">Weather Dashboard</div> */}
        </div>
        <div class="w-100"></div>
      </div>
    </div>
  );
};

export default Portfolio;
